import React, { useRef, useState, useEffect } from "react";
import { library } from "@fortawesome/fontawesome-svg-core";
import { fas } from "@fortawesome/free-solid-svg-icons";
import "../styles/home.css";

import ott1 from "../img/ott1.webp";
import ott2 from "../img/ott2.webp";
import ott3 from "../img/ott3.webp";

library.add(fas);

function HomePage() {
  const nextRef = useRef(null);
  const prevRef = useRef(null);

  const [slides, setSlides] = useState([ott1, ott2, ott3]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [timeoutId, setTimeoutId] = useState(null);

  const timeRunning = 1000;
  const timeAutoNext = 7000; // 7 seconds for auto next

  useEffect(() => {
    const nextDom = nextRef.current;
    const prevDom = prevRef.current;

    const showSlider = (type) => {
      setSlides((prevSlides) => {
        let newSlides;
        if (type === "next") {
          newSlides = [...prevSlides.slice(1), prevSlides[0]];
        } else if (type === "prev") {
          newSlides = [prevSlides[prevSlides.length - 1], ...prevSlides.slice(0, -1)];
        }
        return newSlides;
      });

      const carouselDom = document.querySelector(".carousel");
      if (type === "next") {
        carouselDom.classList.add("next");
      } else {
        carouselDom.classList.add("prev");
      }

      clearTimeout(timeoutId);
      const newTimeoutId = setTimeout(() => {
        carouselDom.classList.remove("next");
        carouselDom.classList.remove("prev");
      }, timeRunning);
      setTimeoutId(newTimeoutId);

      const autoNextTimeoutId = setTimeout(() => {
        nextDom.click();
      }, timeAutoNext);
      setTimeoutId(autoNextTimeoutId);
    };

    const autoNextTimeoutId = setTimeout(() => {
      nextDom.click();
    }, timeAutoNext);
    setTimeoutId(autoNextTimeoutId);

    nextDom.onclick = () => {
      showSlider("next");
    };

    prevDom.onclick = () => {
      showSlider("prev");
    };

    return () => {
      clearTimeout(timeoutId);
    };
  }, [timeoutId]);

  return (
    <div className="carousel">
      <div className="list">
        {slides.map((img, index) => (
          <div className="item" key={index}>
            <img src={img} alt={`Slide ${index + 1}`} />
            <div className="content">
              <div className="title">DESIGN SLIDER</div>
              <div className="topic">ANIMAL</div>
              <div className="des">
                Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ut
                sequi, rem magnam nesciunt minima placeat, itaque eum neque
                officiis unde, eaque optio ratione aliquid assumenda facere ab
                et quasi ducimus aut doloribus non numquam. Explicabo,
                laboriosam nisi reprehenderit tempora at laborum natus unde.
                Ut, exercitationem eum aperiam illo illum laudantium?
              </div>
              <div className="buttons">
                <button>SEE MORE</button>
                <button>SUBSCRIBE</button>
              </div>
            </div>
          </div>
        ))}
      </div>
      <div className="thumbnail">
        {slides.map((img, index) => (
          <div className="item" key={index}>
            <img src={img} alt={`Thumbnail ${index + 1}`} />
            <div className="content">
              <div className="title">Name Slider</div>
              <div className="description">Description</div>
            </div>
          </div>
        ))}
      </div>

      <div className="arrows">
        <button ref={prevRef}>Previous</button>
        <button ref={nextRef}>Next</button>
      </div>
      <div className="time"></div>
    </div>
  );
}

export default HomePage;
